(1, 1, '2015-12-23 17:40:27', '2015-12-23 17:40:27', 'Bem-vindo ao WordPress. Esse é o seu primeiro post. Edite-o ou exclua-o, e então comece a escrever!', 'Olá, mundo!', '', 'publish', 'open', 'open', '', 'ola-mundo', '', '', '2016-03-07 14:54:14', '2016-03-07 14:54:14', '', 0, 'http://www.grau.net.br/penseoftalmo/?p=1', 0, 'post', '', 1),
(2, 1, '2015-12-23 17:40:27', '2015-12-23 17:40:27', '<img class="aligncenter size-full wp-image-72" src="http://www.grau.net.br/penseoftalmo/wp-content/uploads/2015/12/img-empresa.jpg" alt="img-empresa" width="930" height="340" />\r\n\r\nA Grossmed iniciou suas atividades em 2002 com a exclusividade na distribuição dos produtos Rumex no Brasil. Aos poucos, a empresa foi agregando novos produtos voltados ao segmento de oftalmologia.\r\n\r\nAtualmente, a empresa reúne uma variedade de produtos e equipamentos de comprovada qualidade para a área cirúrgica Oftalmológica, como pinças cirúrgicas, óleo de silicone, perfluor, canulas descartáveis retinais, entre outros instrumentos cirúrgicos e equipamentos.\r\n\r\nEm 2012, a empresa lança o Pense Oftalmo, um moderno website voltado aos produtos de oftalmologia comercializados pela Grossmed.\r\n\r\nQueremos agradecer pela oportunidade de apresentar nossos produtos, os quais se destinam a melhorar a performance do seu trabalho.', 'Empresa', '', 'publish', 'closed', 'closed', '', 'empresa', '', '', '2016-01-08 17:21:18', '2016-01-08 17:21:18', '', 0, 'http://www.grau.net.br/penseoftalmo/?page_id=2', 0, 'page', '', 0),
(4, 1, '2016-01-04 19:12:17', '2016-01-04 19:12:17', 'Esta é uma página de exemplo. É diferente de um post porque ela ficará em um local e será exibida na navegação do seu site (na maioria dos temas). A maioria das pessoas começa com uma página de introdução aos potenciais visitantes do site. Ela pode ser assim:\n\n<blockquote>Olá! Eu sou um bike courrier de dia, ator amador à noite e este é meu blog. Eu moro em São Paulo, tenho um cachorro chamado Tonico e eu gosto de caipirinhas. (E de ser pego pela chuva.)</blockquote>\n\nou assim:\n\n<blockquote>A XYZ foi fundada em 1971 e desde então vem proporcionando produtos de qualidade a seus clientes. Localizada em Valinhos, XYZ emprega mais de 2.000 pessoas e faz várias contribuições para a comunidade local.</blockquote>\nComo um novo usuário do WordPress, você deve ir até o <a href="http://www.grau.net.br/penseoftalmo/wp-admin/">seu painel</a> para excluir essa página e criar novas páginas com seu próprio conteúdo. Divirta-se!', 'Empresa', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2016-01-04 19:12:17', '2016-01-04 19:12:17', '', 2, 'http://www.grau.net.br/penseoftalmo/2016/01/04/2-revision-v1/', 0, 'revision', '', 0),
