(124, 1, '2016-01-14 19:02:08', '2016-01-14 19:02:08', 'Cirurgiao: Nikolai Sobolev, Fyodorov Eye Microsurgery InstituteA Phakic Posterior Chamber IOL is removed using the Shery Rowen Rescue Kit (4-2150 + 4-2151) because of the cataract formation. A Continous Curvilinear Capsulorhexis is performed using the Fine-Ikeda MICS Capsulorhexis Forceps (16-2804) and IOL Cartridge Loading Forceps (4-2141).', 'Remoção de LIO Phakic através da facoemulsificação com implantação de LIO multifocal', '', 'trash', 'closed', 'closed', '', 'remocao-de-lio-phakic-atraves-da-facoemulsificacao-com-implantacao-de-lio-multifocal', '', '', '2016-03-03 12:39:43', '2016-03-03 12:39:43', '', 0, 'http://www.grau.net.br/penseoftalmo/?post_type=video&#038;p=124', 0, 'video', '', 0),
