(1739, 1, '2016-01-18 14:21:55', '2016-01-18 14:21:55', '<p style="text-align: center;"><strong> </strong></p> <strong> </strong>- DESPARAFUSE A PONTA DO CABO, COLOQUE O ADAPTADOR DE LIMPEZA 12-000 ( COD. RUMEX).  - LIMPEZA SUPERSONICA PARA AMBAS PARTES, SE POSSIVEL.  - LAVAR A PONTA COM AGUA DESTILADA OU AGUA DESIONIZADA ATRAVÉZ DE CONEXÃO DE SERINGA CHEIA  DE AGUA PARA ADAPTAÇÃO  - LIMPAR A PONTA COM ALCOOL. ISTO PODERÁ  REMOVER A AGUA E FACILITARÁ  A SECAGEM.  - SEQUE A PONTA ATRAVES DE PRESSÃO DE UMA OU DUAS SERINGAS CHEIAS DE AR. É RECOMENDADA PRESSÃO DE AR EMBAIXO, COMO  ISTO LIMPARÁ  RESIDUOS E SUBSTÂNCIAS  EFICIENTEMENTE, DO QUE PRESSÃO DE SERINGA COM AR. SEQUE O CABO PERFEITAMENTE, PONTA E COPO.  - PRESSIONE O INSTRUMENTO ATRAVÉS DA PONTA, SEGUINDO A INSTRUÇÃO Nº 03 ACIMA.  - SEQUE COM AR SEGUINDO A INSTRUÇÃO Nº 05 ACIMA.  - O CABO DEVE SER ENXAGUADO EM AGUA DESTILADA OU DESIONIZADA POR 2 MINUTOS.  - SEQUE COM ESPONJA CIRURGICA.  - LUBRIFIQUE AS JUNTAS (ARTICULAÇÕES) NO CABO COM LEITE DE INSTRUMENTO E TRABALHE O MECANISMO.    <p style="text-align: center;"><strong>ARMAZENAMENTO</strong><strong><em></em></strong></p> A RUMEX, INSTRUMENTOS PARA MENBRANA TEM UM CABO ERGONOMICO EM TITANIO E PONTAS MUITO DELICADAS PARA FORNECER AO CIRURGIÃO CONTROLE E PRECISÃO DURANTE A CIRURGIA. PODERÃO SER ARMAZENADOS EM CAIXAS DE ESTERELIZAR DE TAMANHO PRÓPRIO. ELES  NÃO PODERÃO  TOCAR UM NOS OUTROS. PROTEJA AS PONTAS COM TUBOS FEITOS DE SILICONE SUAVE DE TAMANHO E GROSSURA PRÓPRIA, PODERÃO SER USADOS. NÃO USE BORRACHA OU PLÁSTICO PARA PROTEJER AS PONTAS, POIS  PODE DISSOLVER DURANTE A AUTOCLAVAGEM E  DANIFICA -LOS . USE SOMENTE PONTAS PROTETORAES  DE SILICONE.    <h4 style="text-align: center;"><strong>INSPEÇÃO</strong></h4> <strong>               </strong>DEVE SER DEVIDAMENTE INSPECIONADO OS  INSTRUMENTOS DE MICROCIRURGIA NO TÉRMINO DA CIRURGIA. POR FAVOR CONDUZA ESTA INSPEÇÃO ABAIXO DE UM MICROSCÓPIO OU LENTES DE AUMENTO. SE O INSTRUMENTO ESTIVER DANICADO SERÁ DETECTADO, TROQUE-O . <p align="center"><strong> </strong></p> <p style="text-align: center;"><strong>LIMPEZA MANUAL</strong></p> <strong>     </strong>O INSTRUMENTO DEVE SER  LAVADO PERFEITAMENTE COM ÁGUA DESTILADA.  2 .       LIMPE - O COM UMA ESPONJA CIRURGICA MOLHADA PREVININDO O CONTATO DIRETO COM A PONTA DELICADA DO INSTRUMENTO.  3.     CUIDADOSAMENTE, SEQUE- O ICOM UM VENTILADOR DE AR QUENTE  OU TECIDO LIVRE DE ALGODÃO . VERIFIQUE A PONTA DO INSTRUMENTO EMBAIXO DE LENTES DE AUMENTO OU MICROSCOPIO.  <strong>       </strong><em>  USE UM SABÃO SUAVE E COM UMA ESCOVA MACIA LIMPE O INSTRUMENTO E REMOVA QUALQUER MANCHA. NUNCA USE:</em>  ABRASIVO FEITO DE PÓ E LÃ PARA REMOVER MANCHAS PERSISTENTES – ESTES PODEM DANIFICAR A SUPERFÍCIE DO INSTRUMENTO E AJUDAR A CAUSAR A CORROSÃO OS INSTRUMENTOS IMACULADOS.  USE ÁGUA DESTILADA OU DESMINERALIZADA PARA LAVAR O INSTRUMENTO PERFEITAMENTE, DEPOIS SEQUE  CUIDADOSAMENTE COM UM SECADOR DE AR QUENTE OU PANO DE ALGODÃO.  ESTEJA CERTO DE QUE VOCÊ E MEMBROS DE SEU GRUPO DE TRABALHO  ESTÃO COMPLETAMENTE FAMILIARIZADOS COM AS INSTRUÇÕES DA FABRICAÇÃO, A QUAL VEM COM SEU LIMPADOR ULTRA-SÔNICO.  OS INSTRUMENTOS NÃO PODEM SER COLOCADOS EM CESTA DE ARAME. LAVE PRIMEIRO OS INSTRUMENTOS EMBAIXO DE ÁGUA CORRENTE, E DEPOIS LAVE EM ÁGUA LIMPA DESMINERALIZADA OU DESTILADA. SEQUE COM UM PANO DE ALGODÃO OU VENTILADOR DE AR QUENTE.  <strong> </strong> <p style="text-align: center;"><strong>LIMPEZA  ULTRASONICA</strong></p> <strong>              </strong>A LIMPEZA ULTRASONICA PODE SER  UTILIZADA PARA LIMPAR INSTRUMENTOS DE MENBRANA. ELES DEVEM SER LAVADOS COM ÁGUA DESTILADA ANTES DA LIMPEZA ULTRASÔNICA.  USE SOMENTE SOLUÇÕES DE LIMPEZA RECOMENDADAS PARA AÇO. TROQUE A SOLUÇÃO FREQUENTEMENTE, SEMPRE USE AGUA DESTILADA OU DESMINERALIZADA.  ÁGUA QUENTE A 62ºC USANDO UM AQUECEDOR DE  IMERSÃO, OU DENTRO DE UM RECEPIENTE DIFERENCIADO SEM MANCHAS, SE VOCÊ NÃO TIVER UM MECANISMO AUTOMATICO ADAPTE UM AQUECEDOR DE ÁGUA.  OS INSTRUMETNOS PODERÃO SER COLOCADOS SOBRE UMA ESTEIRA DE SILICONE  E NÃO PODERAM TOCAR UM NO OUTRO.  LAVE PRIMEIRO OS INSTRUMENTOS EMBAIXO DE ÁGUA CORRENTE, E DEPOIS LAVE DENTRO DE ÁGUA LIMPA DESMINERALIZADA OU ÁGUA DESTILADA.  SEQUE COM TECIDO DE ALGODÃO OU SECADOR DE AR QUENTE. <h5></h5> <p style="text-align: center;"><strong> LUBRIFICAÇÃO</strong></p> NORMALMENTE OS INSTRUMENTOS MICROCIRÚRGICOS NÃO EXIGEM BANHO DE LUBRIFICAÇÃO. DE QUALQUER FORMA, ISTO É RECOMENDADO PARA LUBRIFICAR TODAS AS PARTES MÓVEIS (ARTICULAÇÕES) DEPOIS DA LIMPEZA.  USE SOMENTE LUBRIFICANTES DE SILICONE OU TEFLON, OS QUAIS PODEM DMEORAR ABAIXO DA AUTO CLAVAGEM. NÓS RECOMENDAMOS USAR O LEITE PARA INSTRUMENTO ( 16-IM). NUNCA USE LUBRIFICANTE NORMAL. NUNCA OS CUBRA COM LUBRIFICANTES POIS PODEM LEVAR A UMA CORROSÃO.    <p style="text-align: center;"><strong>         ESTERILIZAÇÃO</strong></p> <strong> </strong>             OS INSTRUMENTOS DE AÇO  OU TITÂNIO PODEM SER ESTERILIZADOS ATRAVÉS DE AUTO-CLAVAGEM A VAPORIZAÇÃO DESINFETANTE QUÍMICOS, GÁS DE ÓXIDO DE ETILÊNIO, OU ATÉ MESMO SECAR COM AR QUENTE. GÁS E ESTERILIZAÇÃO QUÍMICA SECA SÃO OS MELHORES MÉTODOS PARA INSTRUMENTOS, MAS ELES REQUEREM UM MAIOR TEMPO PARA EFETUAR O RESULTADO DESEJADO.  A MAIORIAS DOS MÉTODOS PRÁTICOS DE ESTERILIZAÇÃO SÃO POR AQUECIMENTO OU VAPORIZAÇÃO, O QUAL REQUER MENOS TEMPO.  DE QUALQEUR FORMA, ESTES MÉTODOS DE ESTERILIZAÇÃO PODEM CAUSAR DANOS PARA INSTRUMENTOS DELICADOS DE AÇO .E MAIS UMA VEZ, CERTIFIQUE-SE QUE VOCÊ E OS MEMBROS DE SEU GRUPO DE TRABALHO TENHAM, LIDO E ENTENDIDO AS INSTRUÇÕES FORNECIDAS PELO ELABORADOR DE SUA ESTERILIZAÇÃO PARTICULAR.', 'LIMPEZA DE INSTRUMENTOS VITREORETINAIS:', '', 'publish', 'open', 'open', '', 'limpeza-de-instrumentos-vitreoretinais', '', '', '2016-01-18 14:21:55', '2016-01-18 14:21:55', '', 0, 'http://www.grau.net.br/penseoftalmo/product/limpeza-de-instrumentos-vitreoretinais/', 213, 'product', '', 0),
