(1742, 1, '2016-01-18 14:21:55', '2016-01-18 14:21:55', '<p style="text-align: center;" align="left"><strong>RUMEX BISTURIS DE DIAMANTE</strong></p> As laminas de diamante Rumex Internacional®  são feitas de diamante natural, usado por uma substância térmica especial método o qual tem afiação das extremidades cortantes a 500 A. <p align="left"><strong> </strong></p> <p style="text-align: center;" align="left"><strong>RUMEX CABOS DE BISTURI DE DIAMANTE </strong></p> Os cabos para bisturis de diamante Rumex Internacional®  são manufaturados em titânio, o qual é famoso por ser mais leve (40% mais leve do que o aço) não corrosivo e não é de caráter magnético. Nós da Rumex Internacional ®  garantimos por vida o cabo em titânio. <p align="left"><strong> </strong></p> <p style="text-align: center;" align="left"><strong>CUIDADOS E MANUSEIO DOS BISTURIS DE DIAMANTE</strong></p> A lâmina de diamante deve ser sempre examinada antes de cada uso sob um microscópio ou uma lente de aumento. Cuidados devem ser tomados para que a lâmina nunca toque uma superfície de metal. Após cada uso, a lâmina deve ser imediatamente retraída para dentro do cabo, uma vez que o bisturi seja colocado dentro da caixa de esterilização com a lamina não retraída, a probabilidade de danificação do diamante é de 50%. Uma técnica de treinamento dever ser desenvolvida entre o corpo de funcionários e os cirurgiões tal como o bisturi seja retraído para o interior do cabo. <p style="text-align: center;" align="left">LIMPEZA</p> Após  cada uso da lâmina, deverá ser imediatamente enxaguada com <em><span style="text-decoration: underline;">água destilada</span></em> através de seringa. Nunca limpe a lâmina de fora para o ponto da lâmina novamente. Não coloque em aparelho ultrasonico e muito menos em pastilhas, somente com água destilada, vapor, não passe nada em cima da lamina. <p align="left"><em><span style="text-decoration: underline;">Nunca use nenhum líquido ou soluções agressivas, nem solução salina para limpeza.</span></em></p> <p align="left">19-010) Limpador a vapor pode ser usado no procedimento para limpeza<strong>.</strong></p> Adequado para limpeza imprópria, algum resíduo opaco de membrana aparece sobre a lâmina. Isto é adequado para destruir escombros celulares e de sangue sobre a lâmina. Se isto acontecer, a lâmina de diamante poderá ser limpa como mencionada no procedimento acima, uma esponja poderá ser totalmente umedecida com peróxido de hidrogênio. <p style="text-align: center;"><strong><span style="text-decoration: underline;">ESTERILIZAÇĂO</span></strong></p> <p align="left">Os bisturis poderão ser armazenados e protegidos durante a esterilização em uma caixa de plástico especialmente desenhada para esterilização (Capitulo 18, 18-301, 18-301-1, 18-302, 18-302-1) separadamente de outros instrumentos. Bisturis podem ser também esterilizados a gás ou a vapor. As Lâminas poderão ser limpas propriamente antes da esterilização. Caso contrário, o sangue e resíduos de escombro perderam ser fixados sob a lâmina.</p> <p align="left"><strong> </strong></p> <p style="text-align: center;"><strong><span style="text-decoration: underline;">CONSERTOS</span></strong></p> Nós consertamos todos os bisturis de diamante o qual fabricamos. Este serviço  inclui  reparação completa, limpeza e calibração do bisturi.', 'LIMPEZA BISTURIS DE DIAMANTE', '', 'publish', 'open', 'open', '', 'limpeza-bisturis-de-diamante', '', '', '2016-01-18 14:21:55', '2016-01-18 14:21:55', '', 0, 'http://www.grau.net.br/penseoftalmo/product/limpeza-bisturis-de-diamante/', 214, 'product', '', 0),
