(1980, 1, '2016-01-18 14:26:58', '2016-01-18 14:26:58', 'CORNEAL CHAMBER-  CAMARA UMIDA P/ CORNEA CX C/12 UNIDADES  <strong>Informações adicionais sobre o produto :</strong> O FDA (Food and Drug Administration) liberou a aprovação final para o update da exigência do armazenamento do EUSOL-C (escala: +2°C - +25°C).  Mais conveniência, menos limitações! O FDA aprovou a mudança em exigências do armazenamento para EUSOL-C. Antes do uso, o meio pode ser armazenado nas temperaturas que variam de +2°C a +25°C, com um prazo de validade de dois anos. Os Bancos de Olhos agora podem escolher as condições de armazenamento mais apropriadas para suas necessidades. Além disso, os estudos da estabilidade demonstraram que o meio permanece estável até 9 meses em temperaturas entre 38°C e 42°C, assim permitindo o transporte sem refrigeração.   É um produto reconhecido e de sucesso para conservação de córnea. Os bancos de olhos por todo o mundo tentam assegurar o sucesso do transplante de córnea, selecionando os doadores e manipulando adequadamente os tecidos. Durante os últimos 15 anos, os bancos de olhos têm desenvolvido uma série de procedimentos operativos padronizados e técnicas para garantir a qualidade das córneas destinadas ao transplante. Desde 1993, Alchimia tem apreciado uma colaboração próxima com os mais importantes Bancos de Olhos italianos e internacionais. Desenvolvemos uma gama completa de soluções e acessórios para a aquisição, conservação, valoração e transporte sucessivo de tecidos de doadores (globo ou córnea). A conservação hipotérmica da córnea (conservação a frio) é um procedimento simples e seguro para a preservação da córnea doadora a curto prazo. As córneas conservadas em EUSOL-C a 2° - 8°C até 14 dias. Nesta temperatura, o metabolismo e a funcionalidade celular são minímas. O edema da córnea se evita com dextrina e o crescimento bacteriano com sulfato de gentamicina (antibiótico).   EUSOL-C, médio enriquecido com vitaminas, antioxidantes e precursores energéticos, conserva eficazmente as córneas por um período de até duas semanas. No 14° dia de conservação, se observa uma perda estatística das células endoteliais de somente 5%. A espessura fisiológica do tecido se mantém durante todo o tempo de conservação, assegurando uma rápida reabilitação visual do receptor. O uso de um único antibiótico, o sulfato de gentamicina, a uma concentração eficaz fornece uma segura proteção anti-bacteriana, sem nenhum efeito tóxico as células, permitindo uma vida útil de 24 meses. O produto pode ser armazenado sem refrigeração e tolera perfeitamente picos de temperatura durante o transporte e a manipulação. O frasco, com fundo ótico de alta qualidade permite a avaliação microscópica dos tecidos sem que seja transferido a uma outra câmara, assim reduzindo riscos adicionais de contaminação. O indicador da cor vermelha de Fenol fornece uma rápida identificação da variação de pH. EUSOL-C, não contém nenhum derivado animal. Aprovado pelo FDA (Food and Drug Administration).', 'Eusol-C', '', 'publish', 'open', 'open', '', 'eusol-c', '', '', '2016-01-18 14:26:58', '2016-01-18 14:26:58', '', 0, 'http://www.grau.net.br/penseoftalmo/product/eusol-c/', 117, 'product', '', 0),
