(1983, 1, '2016-01-18 14:26:58', '2016-01-18 14:26:58', 'GAS PARA TAMPONAMENTO INTRA OCULAR SF6 75ML  O Gás SF6 (hexafluoreto de enxofre) de alta pureza, com alta tensão superficial para o tamponamento da retina por 10-14 dias. O gás puro deve ser misturado com o ar (10 ml de gás + 40 ml de ar) antes da injeção para obter uma concentração não-expansiva. Pode ser usado como produto descartável ou até ao consumo do conteúdo do cilindro, permitindo a redução de custos da cirurgia. Empacotado em um cilindro de 75ml especialmente desenhado para suportar as variações de pressão e garantir o transporte aéreo sem nenhum problema ou restrições. Na embalagem inclui a seringa pré-montada com filtro esterilizador de 0.2µm, conector e uma cânula de 30G para a retirada, esterilização e injeção do gás para facilitar o manuseio na sala de operação (GIS, kit de injeção de gás); etiquetas e bandas de pulso para a segurança do paciente.', 'Gas SF6', '', 'publish', 'open', 'open', '', 'gas-sf6', '', '', '2016-01-18 14:26:58', '2016-01-18 14:26:58', '', 0, 'http://www.grau.net.br/penseoftalmo/product/gas-sf6/', 118, 'product', '', 0),
