(1986, 1, '2016-01-18 14:26:58', '2016-01-18 14:26:58', 'GAS PARA TAMPONAMENTO INTRA OCULAR C3F8 75ML  O Gás C3F8 (octalfluoropropano) de alta pureza, com alta tensão superficial para o tamponamento da retina por 42-65 dias. O gás puro deve ser misturado com o ar (6 ml de gás + 44 ml de ar) antes da injeção para obter uma concentração não-expansiva. Pode ser usado como produto descartável ou até ao consumo do conteúdo do cilindro, permitindo a redução de custos da cirurgia. Empacotado em um cilindro de 75ml especialmente desenhado para suportar as variações de pressão e garantir o transporte aéreo sem nenhum problema ou restrições. Na embalagem inclui a seringa pré-montada com filtro esterilizador de 0.2µm, conector e uma cânula de 30G para a retirada, esterilização e injeção do gás para facilitar o manuseio na sala de operação (GIS, kit de injeção de gás); etiquetas e bandas de pulso para a segurança do paciente.', 'Gas C3F8-', '', 'publish', 'open', 'open', '', 'gas-c3f8', '', '', '2016-01-18 14:26:58', '2016-01-18 14:26:58', '', 0, 'http://www.grau.net.br/penseoftalmo/product/gas-c3f8/', 119, 'product', '', 0),
