(2230, 1, '2016-01-18 14:32:35', '2016-01-18 14:32:35', 'Lâmpada de Fenda HS5000 + Sistema de Vídeo Digital Huvitz HIS5000  ILUMINAÇÃO - Filtros de cobalto, vermelho Livre, absorção de calor, Amarelo - Rotação da lâmpada de fenda: 0 ° ~ 180 ° - Ângulo de incidência: 0 °, 5 °, 10 °, 15 °, 20 ° - Olho do paciente / Working Distance Prism Superfície: 80 mm  MICROSCÓPIO - Microsoft: HS 5000 5 aumentos - Tipo: Binocular taxa de convergência Galilieu - Ampliação: 5 passos para tambor rotativo - Ocular: 12.5x - Ampliação: 6x, 10x, 16x, 25x, 40x - Ajuste Interpupilar: 55mm ~ 80mm  CÂMERA DIGITAL - Sensor de Imagem: 1 / 2 Interline CCD - Método de Transmissão: IEEE 1394 (6 pinos) - Captura de Foto: Joystick ou software - Dimensões: 44mm (W) x 29mm (H) x 63mm (D) - Consumo: menos de 3W (12DC, de IEEE 1394)  BASE - Movimento Vertical: 28mm - Movimento longitudinal: 78mm - Movimento lateral: 98mm - Fine Base: 10mm - Alimentação: Free Voltage 100 ~ 240V AC - Tensão Frequência: 50 / 60 Hz - Consumo: 70VA - Tensão: 12V DC - Lâmpada halógena: 12V 30W - Ajuste da Lâmpada: 3.4V 20mA  OBS: O SISTEMA NÃO ACOMPANHA COMPUTADOR. É NECESSÁRIO ADQUIRIR O MESMO SEPARADAMENTE.  COMPUTADOR RECOMENDADO Processador Intel I3 ou superior Memória 2GB ou superior HD 500GB ou superior Windows 7 32 bits Placa PCI firewire 6x6  O Sistema de vídeo utiliza entrada FIREWIRE para comunicação com o computador.', 'Lâmp. Fenda + Sist. Vídeo HIS5000', '', 'publish', 'open', 'open', '', 'lamp-fenda-sist-video-his5000', '', '', '2016-01-18 14:32:35', '2016-01-18 14:32:35', '', 0, 'http://www.grau.net.br/penseoftalmo/product/lamp-fenda-sist-video-his5000/', 25, 'product', '', 0),
