(2237, 1, '2016-01-18 14:32:35', '2016-01-18 14:32:35', 'Laser Amarelo IQ 577™ Micropulse  - Primeiro laser de comprimento de onda visível que incorpora a tecnologia MicroPulse™. - Amarelo real, para um comprimento de onda mais preciso. - Disparos mais suaves. - Menos espalhamento de luz do feixe de disparo que ficam confinados e concisos. - Inteligente, sistema intuitivo e ergonômico. - Saída da fibra de porta dupla. - A porta deslizante coberta com proteção de fibra. - Totalmente funcional com controle remoto. - Interface Gráfica. - Visor de LCD colorido de alto contraste. - Predefinições de memória programável. - Design compacto para fácil colocação ou uso em campo. - Permite o controle médico preciso sobre as configurações de energia.  Acessórios opcionais: - Controle remoto. - Pedal sem fio. Laser 532nm - ANVISA: 80497810006 Laser 577nm - ANVISA: 80497810005', 'Laser Amarelo 577nm', '', 'publish', 'open', 'open', '', 'laser-amarelo-577nm', '', '', '2016-01-18 14:32:35', '2016-01-18 14:32:35', '', 0, 'http://www.grau.net.br/penseoftalmo/product/laser-amarelo-577nm/', 27, 'product', '', 0),
