(2239, 1, '2016-01-18 14:32:35', '2016-01-18 14:32:35', 'Laser Verde OcuLight TX  - Combina alta potência com alta velocidade. - Excelente eficiência com 2500 mW de energia do laser. - Durações de pulso que fornecem intervalos de pulso de 10 a 3000 milisegundos. - Fornece TrueCW™ pulsos de laser para o máximo controle e precisão. - Expande o desempenho do sistema com os acessórios convenientes. - Compatível com uma ampla linha de dispositivos da entrega. - Oferece uma ampla seleção de acessórios EndoProbe ® e OtoProbe ™ para uma variedade de procedimentos cirúrgicos. - Oferece excelente ergonomia e uma grande portabilidade. - Funcionamento silencioso elimina distração durante o tratamento. - Controles de simples compreensão que permitem trabalhar ais facilmente com o sistema de laser e dispositivos de entrega. - Transporte facilmente entre salas de tratamento e escritórios. - Permite a padronização da plataforma de laser e de partilha de Otorrinolaringologia e procedimentos oftalmologicos na sala de cirurgia. - Possui somente 1 porta. - Interface gráfica intuitiva com visor de alto contraste de cores. - Confirmação de voz para ajuda técnica cirúrgica.  Acessórios opcionais: - Controle remoto. - Pedal sem fio.  Laser 532nm – ANVISA: 80497810006 Laser 577nm – ANVISA: 80497810005', 'Laser Verde Oculight TX', '', 'publish', 'open', 'open', '', 'laser-verde-oculight-tx', '', '', '2016-01-18 14:32:35', '2016-01-18 14:32:35', '', 0, 'http://www.grau.net.br/penseoftalmo/product/laser-verde-oculight-tx/', 28, 'product', '', 0),
