(2241, 1, '2016-01-18 14:32:35', '2016-01-18 14:32:35', 'Laser OcuLight GL / GLX  - O mais recente em fotocoagulação da retina e a trabeculoplastia. - Fornece TrueCW - pulsos de laser para o máximo controle e precisão. - Projetado para durabilidade com um sistema de gerenciamento térmico e outros recursos para aumentar a eficiência da conversão de laser. - Melhora da interface do usuário com uma localização conveniente, controles de fácil compreensão. - Permite fácil transporte entre escritórios e locais.  A GL oferece até 1.200mW de potência e intervalo de pulso de 50 a 1000 ms  O GLX oferece até 1500mW de potência e intervalo de pulso de 30 a 1000 ms.  - Compatível com um laser integrado / workstation com lâmpada de fenda, adaptadores de lâmpada de fenda (SLAs), um laser Oftalmoscópio Indireto (LIO), e uma variedade de sondas. - Aumenta o desempenho do sistema com os acessórios convenientes. - SLAs Portáteis fornecem capacidade de fotocoagulação transpupilar a laser para mais de 50 modelos de Haag-Streit, Zeiss e sistemas semelhantes de lâmpada de fenda. - TruFocus LIO são ideais para pacientes melhor examinados e tratados em posição levantada.  Laser 532nm – ANVISA: 80497810006 Laser 577nm – ANVISA: 80497810005', 'Laser Verde Oculight GL/GLX', '', 'publish', 'open', 'open', '', 'laser-verde-oculight-glglx', '', '', '2016-01-18 14:32:35', '2016-01-18 14:32:35', '', 0, 'http://www.grau.net.br/penseoftalmo/product/laser-verde-oculight-glglx/', 29, 'product', '', 0),
