(2268, 1, '2016-01-18 14:33:33', '2016-01-18 14:33:33', 'Características: - Modelo: AO - Sincronizado  - Faixa de poder esférico: +16.75D a -19.00D, com leitura mínima de 0.25D ou 0.12D (quando as lentes auxiliares +0.12D ou lentes opcionais +/-0.12D estão em uso) +26.75D a -29.00D (quando as lentes opcionais +/-10.00D estão em uso)  - Faixa de poder cilíndrico: 0 a -6.00D, com leitura mínima de 0.25D ou 0.12D (quando as lentes auxiliares estão em uso) 0 a -8.00D (quando as lentes auxiliares -2.00D estão em uso)  - Escala do eixo de astigmatismo : 0 a 180° em passo s de 5° - Cilindro cruzado: +/-0.25D, tipo reversa (sincronizado com o eixo de astigmatismo) +/-0.50D (opcional) - Prisma rotativo: 0 a 20_ D em passos de 1_ D  - Ajuste interpupilar: 48mm a 80mm com passo de 1mm (direito e esquerdo sincronizados). - Ajuste do descanso de testa: 16mm para trás e para frente. - Convergência: Os eixos ópticos das lentes são alinhados com uma distância de 400mm dos vértices das córneas (2mm cada para direita e esquerda em direção ao interior). - Distância interpupilar permitindo convergência = 57mm a 80mm Campo de visão efetivo: 19 mm', 'Refrator Apramed - AO Sinc.', '', 'publish', 'open', 'open', '', 'refrator-apramed-ao-sinc', '', '', '2016-01-18 14:33:33', '2016-01-18 14:33:33', '', 0, 'http://www.grau.net.br/penseoftalmo/product/refrator-apramed-ao-sinc/', 3, 'product', '', 0),
