(2275, 1, '2016-01-18 14:33:33', '2016-01-18 14:33:33', 'Cirurgiao: Yuriy Takhtaev Fyodorov Eye Microsurgery Institute, St.Petersburg Branch, Russia  2 side port incisions at 2` and 10` are created using the 6-10/6-050 Diamond Knife. Continous Curvilinear Capsulorhexis is made using the 4-03731 Kershner Capsulorrhexis Forceps. Bimanual sleeveless phaco is performed using the 7-077/I Irrigating PhacoChopper & Small Pupil Snapper. Residual cortex material is removed with the help of 7-081/7-0821 Bimanual I/A System. Coaxial incision with the 6-20/6-072 Clear Cornea 2.8mm Diamond Knife is made at 12`.', 'Cirurgia de Catarata com Microincisao Bimanual', '', 'publish', 'open', 'open', '', 'cirurgia-de-catarata-com-microincisao-bimanual', '', '', '2016-01-18 14:33:33', '2016-01-18 14:33:33', '', 0, 'http://www.grau.net.br/penseoftalmo/product/cirurgia-de-catarata-com-microincisao-bimanual/', 6, 'product', '', 0),
